.header-hero {
  overflow: hidden;

  background-color: var(--bg-hero);
}

.header {
  background-color: var(--bg-hero);
  max-width: 1280px;
  margin: 0 auto;

  @media screen and (max-width: 1279px) {
    max-width: 900px;
  }
}

.Logo-icon {
  transition: var(--transition-duration) var(--timing-function);
  fill: var(--main-dark-color);
  background-color: var(--text-color-dark-bg);
  border-radius: 50%;
}

.hero-section {
  z-index: 2;
  position: relative;

  padding: 5px 20px;

  @media screen and (min-width: 768px) {
    padding: 35px 40px;
    padding-bottom: 15px;
  }
  @media screen and (min-width: 1280px) {
    padding-bottom: 85px;
  }
}

.hero-case {
  position: relative;
  min-width: 170px;
}

.logo-case {
  display: flex;
}

.navigation-case,
.Buy-now-button,
.notitia-case,
.soooooo-tasty {
  display: none;
}

.soooooo-image {
  margin-top: auto;
}

.soooooo-tasty {
  @media screen and (min-width: 768px) {
    display: flex;
    padding-right: 50px;
    flex-direction: column;
    height: 100%;
    justify-content: space-between;
  }

  @media screen and (min-width: 1280px) {
    padding-right: 110px;
  }
}

.signature {
  font-family: DM Sans;
  font-style: normal;
  font-weight: normal;
  font-size: 8px;
  line-height: 10px;
  text-align: right;

  color: var(--text-color-dark-bg);

  @media screen and (min-width: 1280px) {
    font-size: 14px;
    line-height: 1.286;
  }
}

.navigation-case {
  @media screen and (min-width: 1280px) {
    display: flex;
    align-items: center;
  }
}

.right-case {
  z-index: 1;

  @media screen and (min-width: 768px) {
    margin-top: 40px;
  }
  @media screen and (min-width: 1280px) {
    margin-top: 0;
  }
}

.nav {
  transition: var(--transition-duration) var(--timing-function);
  font-family: DM Sans;
  font-style: normal;
  font-weight: bold;
  font-size: 14px;
  line-height: 1.285;
  color: var(--text-color-dark-bg);
}

.navigation-list {
  display: flex;
  align-items: center;
}

.navigation-list-item {
  &:hover .nav:hover,
  &:focus .nav:focus {
    color: var(--main-dark-color);
  }

  &:not(:last-child) {
    margin-right: 50px;
  }
}

.nav-block {
  display: flex;
  margin: 0 auto;
}

.notitia-case {
  margin-top: 16px;

  @media screen and (min-width: 768px) {
    display: flex;
    align-items: center;
    // padding-bottom: 25px;
    margin-top: 20px;
  }
  @media screen and (min-width: 1280px) {
    margin-top: 55px;
    display: flex;
    align-items: center;
  }
}

.title-notitia {
  font-family: DM Sans;
  font-style: normal;
  font-weight: normal;
  font-size: 8px;
  line-height: 1.25;

  color: var(--text-color-dark-bg);

  @media screen and (min-width: 1280px) {
    margin-bottom: 20px;
    font-size: 14px;
    line-height: 1.286;
  }
}

.title-but-link {
  transition: var(--transition-duration) var(--timing-function);

  &:hover .title-button-icon:hover,
  &:focus .title-button-icon:focus {
    background: var(--hover-light-bg-btn);
  }
}

.title-case {
  width: 115px;
  height: 50px;

  @media screen and (min-width: 1280px) {
    margin-left: 30px;
    width: 200px;
    height: 80px;
  }
}

.btn-case {
  display: flex;
  align-items: center;
  margin-left: auto;
}

.Buy-now-button {
  z-index: 2;
  font-family: DM Sans;
  font-style: normal;
  font-weight: bold;
  font-size: 16px;
  line-height: 21px;

  @media screen and (min-width: 768px) {
    display: flex;
    align-items: center;
    margin-left: 30px;

    background-color: var(--text-color-dark-bg);

    color: var(--main-dark-color);
    background: var(--text-color-dark-bg);
    border-radius: 20px;
    padding: 6px 60px;

