    line-height: 1.157;
  }
}

.slogan-prefix {
  font-family: Titan One;
  font-style: normal;
  font-weight: normal;
  font-size: 46px;
  line-height: 1.043;
  letter-spacing: 0.06em;
  text-transform: uppercase;
  color: var(--main-dark-color);

  @media screen and (min-width: 768px) {
    font-size: 30px;
