  background: var(--text-color-dark-bg);
  border-radius: 20px;

  &:first-child {
    background: var(--main-dark-color);
    margin-right: 8px;

    &:hover,
    &:focus {
      background: var(--hover-dark-bg-btn);
    }
  }

  & .header-but-link {
    color: var(--main-dark-color);
  }

  &:first-child {
    background: var(--main-dark-color);
    margin-right: 8px;

    &:hover,
    &:focus {
      background: var(--hover-dark-bg-btn);
