    height: 26px;
    padding: 7px;
  }
}

.header-but-link {
  font-family: DM Sans;
  font-style: normal;
  font-weight: normal;
  font-size: 8px;
  line-height: 1.25;
  display: flex;
  align-items: center;
  text-align: center;
}

.logotype {
  display: flex;
  align-items: center;
  text-transform: uppercase;
  transition: var(--transition-duration) var(--timing-function);

  &:hover .logo-icecream,
  &:focus .logo-icecream,
  &:hover .Logo-icon,
  &:focus .Logo-icon {
    color: var(--hover-dark-bg-btn);
    fill: var(--hover-dark-bg-btn);
  }
  &:hover .Logo-icon,
  &:focus .Logo-icon {
    background-color: var(--hover-light-bg-btn);
  }
}

.logo-icecream {
  transition: var(--transition-duration) var(--timing-function);
  display: flex;
  padding-left: 20px;
  font-family: Titan One;
  font-style: normal;
  font-weight: normal;
  font-size: 26px;
  line-height: 1.153;

  text-align: center;
  letter-spacing: 0.04em;

  color: var(--main-dark-color);
}

.burger-case {
  display: flex;
  align-items: center;

  @media screen and (min-width: 1280px) {
    display: none;
  }
}

.burger-btn {
  z-index: 2;
  transition: var(--transition-duration) var(--timing-function);
  padding: 0;
  display: flex;
  margin-left: auto;
  align-items: center;
  background-color: transparent;
  border: none;
  fill: var(--main-dark-color);
  &:hover,
  &:focus {
