.products-item {
  width: 280px;
  padding-top: 160px;
  padding-bottom: 40px;
  border-radius: 24px;
  text-align: center;
  transition-property: box-shadow;
  transition-duration: var(--transition-duration);
  transition-timing-function: var(--timing-function);

  @media screen and(max-width:767px) {
    &:not(:last-child) {
      margin-bottom: 120px;
    }
